  false,\n\t\"url\": null,\n\t\"notes\": \"A Storage Tank Location is a DEP primary
  facility type, and its sole sub-facility is the storage tank itself. Storage tanks
  are aboveground or underground, and are regulated under Chapter 245 pursuant to
  the Storage Tank and Spill Prevention Act. Storage tanks currently contain, have
  contained in the past, or will contain in the future, petroleum or a regulated hazardous
  substance. Above ground storage tanks that either contain hazardous materials or
  have a capacity greater than 21000 are removed.\",\n\t\"license_title\": null,\n\t\"extras\":
